import ItemCard from "./ItemCard"
import {Route} from 'react-router-dom'
import OdjelList from "./OdjelList";
import Nesto from "./nesto";

function App() {
  return (
    <div>
      <Route path="/" exact>
        <OdjelList />
      </Route>
      <Route>
        <Nesto />
      </Route>
    </div>

  );
}

export default App;
